- input: "TEXT\x1CC00519835\x1C.TEXT\x1C\x1CF3XA\x1CIn response to the letter regarding
    reporting period (07/01/2012-07/31/2012) additional information requested: 1.
    Angus S. King Jr. information has been updated with the correct candidate information
    for the 2012 Maine Primary Election revised from the California Primary Election.
    2. Little Weapons has been updated with a memo that it was directing services
    for an icPurple commercial that was used for several candidates. We allocated
    the directing services cost in July to the various candidates whose information
    was presented. It was billed to us on 07/13/2012 and paid on 07/16/2012.\n"
